function show() {
    var xhr = new XMLHttpRequest();
    xhr.open('GET', 'http://localhost:4001/comments');
    xhr.send();
    xhr.onreadystatechange = function () {
        if (xhr.readyState === 4) {
            var container = document.querySelector('.container');
            var data = Array.from(JSON.parse(xhr.responseText));

            data.forEach(function (object) {
                var obj = document.createElement('ul');
                container.appendChild(obj);
                for (var i in object) {
                    var objEl = document.createElement('li');
                    objEl.textContent = object[i];
                    obj.appendChild(objEl);
                }
            });
        }
    };
}

show();

